  `email` varchar(50) DEFAULT NULL COMMENT '用户邮箱',
  `account_pwd` varchar(36) DEFAULT NULL COMMENT '账号密码',
  `nick_name` varchar(50) DEFAULT NULL COMMENT '昵称',
  `user_head_img` varchar(100) DEFAULT NULL COMMENT '用户头像url',
  `account_type` char(1) DEFAULT NULL COMMENT '用户类型 1：前台用户 2：后台用户',
  `work_number` varchar(20) DEFAULT '' COMMENT '工号，只针对后台用户',
  `register_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '注册时间',
  `register_ip` varchar(50) DEFAULT NULL COMMENT '注册IP',
  `register_source` char(1) DEFAULT NULL COMMENT '注册来源',
  `last_login_time` datetime DEFAULT NULL COMMENT '最后登陆时间',
  `last_login_ip` varchar(50) DEFAULT NULL COMMENT '最后登陆IP',
  `login_count` varchar(10) DEFAULT NULL COMMENT '登陆次数',
  `role_id` varchar(200) DEFAULT NULL COMMENT '角色ID 多角色以 逗号隔开',
  `onlie_state` char(1) DEFAULT NULL COMMENT '在线状态 1：在线 0：离线',
  `account_state` char(1) DEFAULT '1' COMMENT '账号状态 1：启用 2：禁用 3：注销',
  `del_state` char(1) DEFAULT '1' COMMENT '删除状态 1:未删除 0：已删除',
  `personal_auth_flag` char(1) DEFAULT NULL COMMENT '是否已个人实名认证 1：是  0:否',
  `company_auth_flag` char(1) DEFAULT NULL COMMENT '是否已企业认证 1：是 0：否',
  `bind_card_flag` char(1) DEFAULT NULL COMMENT '是否绑定银行卡 1：是 0：否',
  `bind_alipayno_flag` char(1) DEFAULT NULL COMMENT '是否绑定支付宝 1：是 0：否',
  `bind_wxno_flag` char(1) DEFAULT NULL COMMENT '是否绑定微信 1：是 0：否',
  `share_code` varchar(8) DEFAULT NULL COMMENT '分享码',
  `forbid_code_flag` char(1) DEFAULT NULL COMMENT '是否禁止：0.正常；1.禁止',
  `create_user` varchar(36) DEFAULT NULL,
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `last_edit_user` varchar(36) DEFAULT NULL,
  `last_edit_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `account_code_bind_time` datetime DEFAULT NULL COMMENT '账号绑定时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `t_sys_auth_atta`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_auth_atta`;
CREATE TABLE `t_sys_auth_atta` (
  `id` varchar(36) NOT NULL DEFAULT '',
  `auth_record_id` varchar(36) DEFAULT NULL COMMENT '实名认证记录ID 包含企业实名认证和 个人实名认证',
  `atta_name` varchar(50) DEFAULT NULL COMMENT '附件名',
  `atta_path` varchar(100) DEFAULT NULL COMMENT '附件存放地址',
  `atta_desc` varchar(100) DEFAULT NULL COMMENT '附件描述',
  `material_name` varchar(50) DEFAULT NULL COMMENT '附件对应材料名称 如：身份证正面',
  `upload_time` datetime DEFAULT NULL COMMENT '上传时间',
  `del_state` char(1) DEFAULT NULL COMMENT '删除状态 1：未删除 0：已删除',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `t_sys_auth_personal`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_auth_personal`;
CREATE TABLE `t_sys_auth_personal` (
  `id` varchar(36) NOT NULL DEFAULT '',
  `sys_account_id` varchar(36) DEFAULT NULL COMMENT '账号表主键',
  `auth_type` char(1) DEFAULT NULL COMMENT '认证类型 1：身份证 2：护照',
  `real_name` varchar(50) DEFAULT NULL COMMENT '真实姓名',
  `card_no` varchar(30) DEFAULT NULL COMMENT '证件号码',
  `address_in_china` varchar(300) DEFAULT NULL COMMENT '在中国居住地址',
  `come_date` varchar(30) DEFAULT NULL COMMENT '到达中国的日期',
  `legal_name` varchar(200) DEFAULT NULL COMMENT '法定名称',
  `auth_state` char(1) DEFAULT NULL COMMENT '认证状态 0：待审核 1：通过 2：不通过',
  `del_state` char(1) DEFAULT NULL COMMENT '删除状态 1：未删除 0：已删除',
  `auth_time` datetime DEFAULT NULL COMMENT '实名认证时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `t_sys_auth_result`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_auth_result`;
CREATE TABLE `t_sys_auth_result` (
  `id` varchar(36) NOT NULL DEFAULT '',
  `auth_record_id` varchar(36) DEFAULT NULL COMMENT '实名认证记录表主键包含个人和企业实名',
  `auditor` varchar(36) DEFAULT NULL COMMENT '审核人',
  `audit_time` datetime DEFAULT NULL COMMENT '审核时间',
  `audit_result` char(1) DEFAULT NULL COMMENT '审核结果 1：通过  0：不通过',
  `audit_description` varchar(200) DEFAULT NULL COMMENT '审核意见',
  `create_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `t_sys_dictionary`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_dictionary`;
CREATE TABLE `t_sys_dictionary` (
  `id` varchar(36) NOT NULL COMMENT '数据id',
  `pid` varchar(36) DEFAULT NULL COMMENT '父级id',
  `name` varchar(30) DEFAULT NULL COMMENT '字典名称',
  `value` varchar(30) DEFAULT NULL COMMENT '字典值',
  `type` varchar(30) DEFAULT NULL COMMENT '字典类型',
  `type_name` varchar(30) DEFAULT NULL COMMENT '类型名称',
  `sort` int(11) DEFAULT NULL COMMENT '排序',
  `del_state` char(1) DEFAULT '1' COMMENT '删除状态 1：未删除 0：已删除',
  `create_user` varchar(36) DEFAULT NULL COMMENT '创建人',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `last_edit_user` varchar(36) DEFAULT NULL COMMENT '最后修改人',
  `last_edit_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `idx_type` (`type`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='字典表';

-- ----------------------------
--  Table structure for `t_sys_log`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_log`;
CREATE TABLE `t_sys_log` (
  `id` varchar(36) NOT NULL DEFAULT '',
  `table_name` varchar(30) DEFAULT NULL COMMENT '表名',
  `business_name` varchar(100) DEFAULT NULL COMMENT '业务名称',
  `operator_id` varchar(36) DEFAULT NULL COMMENT '操作者ID',
  `ip` varchar(20) DEFAULT '' COMMENT '登陆IP',
  `operate_type` varchar(1) DEFAULT NULL COMMENT '操作类型 1：新增 2：修改 3：删除 4：登陆 5：登出',
  `operate_time` datetime DEFAULT NULL COMMENT '操作时间',
  `del_state` char(1) DEFAULT '1' COMMENT '删除状态1：未删除 0：已删除',
  `create_time` datetime DEFAULT NULL,
  `last_edit_time` datetime DEFAULT NULL,
  `last_edit_user` varchar(36) DEFAULT NULL COMMENT '最后修改人',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `t_sys_menu`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_menu`;
CREATE TABLE `t_sys_menu` (
  `id` varchar(36) NOT NULL DEFAULT '',
  `menu_name` varchar(30) DEFAULT '' COMMENT '菜单名称',
  `menu_code` varchar(20) DEFAULT '' COMMENT '菜单编码',
  `p_menu_id` varchar(36) DEFAULT '' COMMENT '上级菜单id',
  `menu_level` char(1) DEFAULT NULL COMMENT '菜单层级',
  `menu_url` varchar(100) DEFAULT '' COMMENT '菜单URL',
  `menu_icon` varchar(20) DEFAULT '' COMMENT '菜单图标',
  `menu_state` char(1) DEFAULT '1' COMMENT '菜单状态 1：启用 2：禁用',
  `menu_type` char(1) DEFAULT NULL COMMENT '菜单类型 1:前台 2：后台',
  `location` char(1) DEFAULT NULL COMMENT '菜单位置（1：顶部，2：左侧）',
  `sort` int(11) DEFAULT '0' COMMENT '排序',
  `del_state` char(1) DEFAULT '1' COMMENT '删除状态 1：未删除 0：已删除',
  `create_user` varchar(36) DEFAULT NULL,
  `create_time` datetime DEFAULT NULL,
  `last_edit_user` varchar(36) DEFAULT NULL,
  `last_edit_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='系统菜单表';

-- ----------------------------
--  Table structure for `t_sys_msg`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_msg`;
CREATE TABLE `t_sys_msg` (
  `id` varchar(36) NOT NULL DEFAULT '',
  `msg_title` varchar(200) DEFAULT NULL COMMENT '消息标题',
  `msg_content` text COMMENT '消息内容',
  `msg_pushtime` datetime DEFAULT NULL COMMENT '消息推送时间',
  `msg_url` varchar(200) DEFAULT NULL COMMENT '消息链接 可未null',
  `msg_type` char(1) DEFAULT NULL COMMENT '消息类型 1：系统类消息 2：业务类消息、3：公告消息',
  `msg_state` char(1) DEFAULT NULL COMMENT '消息状态 1：已发布 0：未发布 ;2.已删除（公告使用）;3.已下线',
  `del_state` char(1) DEFAULT NULL COMMENT '删除状态 1：未删除 0：已删除',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '记录生成时间',
  `create_user` varchar(36) DEFAULT NULL,
  `last_eidt_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `last_edit_user` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `t_sys_msg_user`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_msg_user`;
CREATE TABLE `t_sys_msg_user` (
  `id` varchar(36) NOT NULL DEFAULT '',
  `msg_id` varchar(36) DEFAULT NULL COMMENT '消息ID',
  `user_id` varchar(36) DEFAULT NULL COMMENT '用户ID',
  `read_state` char(1) DEFAULT NULL COMMENT '阅读状态 1：已读 0：未读',
  `del_state` char(1) DEFAULT NULL COMMENT '删除状态 1：未删除 0：已删除',
  `read_time` datetime DEFAULT NULL COMMENT '阅读时间',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '记录创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `t_sys_organization`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_organization`;
CREATE TABLE `t_sys_organization` (
  `id` varchar(36) COLLATE utf8_bin NOT NULL COMMENT '机构id',
  `code` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '机构编码',
  `name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '机构名称',
  `pid` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '上级机构id',
  `type` varchar(20) COLLATE utf8_bin DEFAULT NULL COMMENT '机构类型',
  `del_state` char(1) COLLATE utf8_bin DEFAULT '1' COMMENT '删除状态 1：未删除 0：已删除',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `create_user` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '创建人',
  `last_edit_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `last_edit_user` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=COMPACT;

