-- ----------------------------
DROP TABLE IF EXISTS `t_sys_organization_member`;
CREATE TABLE `t_sys_organization_member` (
  `id` varchar(36) COLLATE utf8_bin NOT NULL COMMENT 'id',
  `org_id` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '机构id',
  `user_id` varchar(36) COLLATE utf8_bin DEFAULT NULL COMMENT '成员id',
