-- ----------------------------
--  Table structure for `t_sys_price`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_price`;
CREATE TABLE `t_sys_price` (
  `id` varchar(36) NOT NULL COMMENT '主键',
  `source_language` varchar(50) DEFAULT NULL COMMENT '源语言',
  `target_language` varchar(50) DEFAULT NULL COMMENT '目标语言',
  `order_type` char(1) DEFAULT NULL COMMENT '订单类型：1、快翻；2、文档翻译；3、口译；',
  `translate_level` char(1) DEFAULT NULL COMMENT '翻译等级：0、无；1、标准；2、专业；3、母语；4、专家；11、标准化证件；12、非标准证件；21；创意翻译',
  `doc_type` char(1) DEFAULT NULL COMMENT '文本类型：1、中文翻译（字）；2、外文翻译（词）；3、证件翻译（页）；4、词条翻译（条）',
  `price` decimal(8,2) DEFAULT NULL COMMENT '单价',
  `price_type` char(1) DEFAULT NULL COMMENT '价格类型：1、标准价；2、起步价；3:、咨询客服',
  `del_state` char(1) DEFAULT '1' COMMENT '删除标志：1、未删除，0、已删除',
  `create_user` varchar(36) DEFAULT NULL COMMENT '创建人',
  `create_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `last_edit_user` varchar(36) DEFAULT NULL COMMENT '最后修改人',
  `last_edit_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '最后修改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='翻译价格表';

-- ----------------------------
--  Table structure for `t_sys_price_setting`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_price_setting`;
CREATE TABLE `t_sys_price_setting` (
  `id` varchar(36) NOT NULL,
  `source_language` varchar(10) DEFAULT NULL COMMENT '源语言',
  `target_language` varchar(10) DEFAULT NULL COMMENT '目标语言',
  `level` varchar(10) DEFAULT NULL COMMENT '等级',
  `unit` varchar(8) DEFAULT NULL COMMENT '单位',
  `price` decimal(12,2) DEFAULT NULL COMMENT '价格',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `t_sys_role`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_role`;
CREATE TABLE `t_sys_role` (
  `id` varchar(36) NOT NULL DEFAULT '',
  `role_name` varchar(20) DEFAULT '' COMMENT '角色名称',
  `role_code` varchar(20) DEFAULT '' COMMENT '角色编码',
  `role_type` char(1) DEFAULT NULL COMMENT '角色类型 1：后台角色 2：前台角色',
  `role_state` char(1) DEFAULT '1' COMMENT '角色状态 1：启用 0：禁用',
  `role_desc` varchar(500) DEFAULT NULL COMMENT '角色说明',
  `del_state` char(1) DEFAULT '1' COMMENT '删除状态1：未删除 0：已删除',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `create_user` varchar(36) DEFAULT NULL,
  `last_edit_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `last_edit_user` varchar(36) DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='系统角色表';

-- ----------------------------
--  Table structure for `t_sys_role_menu`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_role_menu`;
CREATE TABLE `t_sys_role_menu` (
  `id` varchar(36) NOT NULL DEFAULT '',
  `role_id` varchar(36) DEFAULT NULL COMMENT '用户id',
  `menu_id` varchar(36) DEFAULT NULL COMMENT '菜单ID',
  `del_state` char(1) DEFAULT '1' COMMENT '删除状态1：未删除 0：已删除',
  `create_user` varchar(36) DEFAULT NULL,
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='系统角色菜单关联表';

-- ----------------------------
--  Table structure for `t_sys_user`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_user`;
CREATE TABLE `t_sys_user` (
  `id` varchar(36) NOT NULL,
  `sys_account_id` varchar(36) DEFAULT '' COMMENT 't_sys_account主键',
  `user_name` varchar(30) DEFAULT NULL COMMENT '姓名',
  `card_type` char(1) DEFAULT NULL COMMENT '证件类型 1：身份证',
  `card_no` varchar(30) DEFAULT NULL COMMENT '身份证号码',
  `user_sex` char(1) DEFAULT NULL COMMENT '性别 1：男 2：女 3：保密',
  `user_age` tinyint(3) DEFAULT NULL COMMENT '年龄',
  `user_city` varchar(50) DEFAULT NULL COMMENT '所在城市',
  `del_state` char(1) DEFAULT NULL COMMENT '删除状态 1：未删除 0：已删除',
  `create_time` datetime DEFAULT NULL,
  `last_edit_time` datetime DEFAULT NULL,
  `union_card` varchar(30) DEFAULT NULL COMMENT '银行卡号',
  `aipay_acoount` varchar(50) DEFAULT NULL COMMENT '支付宝账号',
  `aipay_user` varchar(50) DEFAULT NULL COMMENT '支付宝用户名',
  `open_bank` varchar(50) DEFAULT NULL COMMENT '开户行',
  `wechat_no` varchar(50) DEFAULT NULL COMMENT '微信号',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `t_sys_validate_code`
-- ----------------------------
DROP TABLE IF EXISTS `t_sys_validate_code`;
CREATE TABLE `t_sys_validate_code` (
  `id` varchar(36) NOT NULL DEFAULT '',
  `send_type` char(1) DEFAULT NULL COMMENT '发送方式 1：短信发送 2：邮箱发送',
  `mobile_phone` varchar(20) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `validate_code` varchar(6) DEFAULT NULL COMMENT '验证码',
  `send_time` datetime DEFAULT NULL COMMENT '发送时间',
  `dead_time` datetime DEFAULT NULL COMMENT '失效时间',
  `code_state` char(1) DEFAULT NULL COMMENT '状态 1：有效 0：无效',
  `send_state` char(1) DEFAULT NULL COMMENT '发送状态 0：未发送 1：已发送',
  `del_state` char(1) DEFAULT NULL COMMENT '删除状态 1：未删除 0：已删除',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '记录创建时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

-- ----------------------------
--  Table structure for `t_translator_ablity_base`
-- ----------------------------
DROP TABLE IF EXISTS `t_translator_ablity_base`;
CREATE TABLE `t_translator_ablity_base` (
  `id` varchar(36) NOT NULL,
  `resume_id` varchar(36) DEFAULT NULL,
  `mother_tongue` varchar(36) DEFAULT NULL COMMENT '母语',
  `minority_language` varchar(100) DEFAULT NULL COMMENT '少数民族语言',
  `better_industry` varchar(100) DEFAULT NULL COMMENT '擅长行业',
  `better_field` varchar(600) DEFAULT NULL COMMENT '擅长领域（用符号号隔开）',
  `translation_total` varchar(10) DEFAULT NULL COMMENT '翻译总量',
  `better_foreign_languages` varchar(600) DEFAULT NULL COMMENT '擅长外语（用符号隔开）',
  `better_software` varchar(100) DEFAULT NULL COMMENT '擅长软件',
  `person_works` varchar(1000) DEFAULT NULL COMMENT '代表作(附件id多个用符号隔开)',
  `seniority_attr` varchar(1000) DEFAULT NULL COMMENT '资历证明（附件id,多个用符号隔开）',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `last_edit_time` datetime DEFAULT NULL,
  `last_edit_user` varchar(36) DEFAULT NULL,
  `expert_type` char(1) DEFAULT NULL COMMENT '擅长类型：1.口译 2.笔译',
  `del_state` char(1) DEFAULT '1' COMMENT '删除状态 1：未删除 0：已删除',
  PRIMARY KEY (`id`) USING BTREE,
